import React from 'react';

const EducationalInfo = () => {
	return (
		<div className='educational-info'>
			<div className='educational-info-container'>
				<p className='educational-info-content'>
					Rick DeJonge has a Bachelor of Music and a Master of Educational
					Leadership from Western Michigan University. He spent thirteen years
					in public education having taught high school band, high school choir,
					and elementary music. He remains active working with bands across the
					country and has recently worked with Honor Bands and All State Bands
					in Colorado, Tennessee, Florida, Texas, Michigan, Wisconsin, and
					Indiana. Rick’s unique programming for children’s education programs
					with orchestra have received rave reviews.
				</p>
				<div className='educational-info-img' />
			</div>
		</div>
	);
};

export default EducationalInfo;
